//測試個人

import React,{Component,useState} from "react";
// import {LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} from"recharts";
import { Line } from "react-chartjs-2";
import {Div0,DataDrawItem,Div1} from'./sty';
// import {Dataq} from './data.js'
const token ='eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTI4MjIxfQ.haRQR3q03ZaRxsfKk7dkjI_sys3yt04JpxT1hfnOsgc';
var dataa=[];


var data12345={
    
    labels:['10/11','10/12','10/13','10/14','10/15'],
    datasets:[
        {
            label: "biceps",
            data: [1,2,6,5,8],
            fill: true,
            backgroundColor: "rgba(75,192,192,0.2)",
            borderColor: "rgba(75,192,192,1)",
            lineTension: 0.4
        }
    ]
}
var a=[];
var bicepstimes=[]
fetch('https://backend-111406.onrender.com/api/record/user4', {
                method: "GET",
                headers: new Headers({
                    'Content-Type': 'application/json',
                    'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTI5MDM1fQ.yqMTieB2EfFsv5AwJ3htU32VmbiatO2IkZmKPNVS13g`, /* 把token放在這 */
                })
}
    )
    .then(function(response) {
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson.data);
        return myJson.data;
      })
      .then(function(myData) {
        for (var i = 0; i < myData.length; i++) {
            if(myData[i].part=='二頭肌'){
                bicepstimes.push(myData[i].times);
                a.push(myData[i].create_time);
            }
          }
      });

class DataDrawList extends Component{
    constructor(props){
        super(props);
        this.state={
        "data":[]
    };
    }
    componentDidMount(){
    this.getItems();
    }
    getItems(){
    fetch('https://backend-111406.onrender.com/api/record/user4', {
                method: "GET",
                headers: new Headers({
                    'Content-Type': 'application/json',
                    'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTI5MDM1fQ.yqMTieB2EfFsv5AwJ3htU32VmbiatO2IkZmKPNVS13g`, /* 把token放在這 */
                })
}
    )
    .then(results=>results.json())
    .then(results=>{this.setState({"datatimes":results.data})});
    }
    render(){
        return (
                <Div0>
                    <DataDrawItem>
                        
                        <Line data={data12345} />
                    </DataDrawItem>
                    <DataDrawItem>
                    {/* <LineChart width={400} height={250} data={data}
                    margin={{top: 5, right: 30, left: 20, bottom: 5}}>
                <XAxis dataKey="name"/>
                <YAxis/>
                <CartesianGrid strokeDasharray="3 3"/>
                <Tooltip/>
                <Legend />
                <Line type="monotone" dataKey="biceps" stroke="#8884d8" activeDot={{r: 8}}/>
                <Line type="monotone" dataKey="deltoid" stroke="#82ca9d" />
                <Line type="monotone" dataKey="squat" stroke="#7C9C99" />
            </LineChart> */}
                    </DataDrawItem>
                    <DataDrawItem></DataDrawItem>
                </Div0>
        )}}
export default DataDrawList;
